import { BrowserRouter, Routes, Route} from "react-router-dom";
import Details from '../pages/Details'
import App from '../App'
const Router = () => {
    return (
        <BrowserRouter>
            <Routes>
                <Route path ="/" element={<App/>}/>
                <Route path ="details/:id" element={<Details/>}/>
            </Routes>
        </BrowserRouter>
    )
} 

export default Router
